import React from 'react';

class JobsSection extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            services: staticServices(),
        }
    }

    render(){
        return (
            <div className={'jobs-section'}>
                <p> This is a Jobs section </p>
            </div>
        )
    }
}

export default JobsSection;
